Montrell Seay and Laura Abriola, biotechnologists in the Yale Center for Molecular Discovery at West Campus, partner with Yale scientists looking for new or modified drugs to advance their translational research. In aiding target and drug discovery, Montrell and Laura have access to 300,000 small molecules and 18,000 genomic probes (segments of DNA strands). 

